                  },
                  {
                    path: 'api',
                    component: ComponentOverviewComponent
                  },
                  {
                    path: 'examples',
                    component: ComponentExamplesComponent
                  }
                ],
                resolve: {
                  data: ComponentResolver
                }
              }
            ]
          }
        ]
      }
    ]),
  ],
  exports: [
    RouterModule
  ]
})
